@Cartabellotta Quindi anche sul clima lei ha la capacità di discernere immediatamente? 
Nonostante pareri autorevoli di persone serissime e stimatissime contrari a quelli autorevoli di persone altrettanto serie e stimate…
Uomo fortunato.

@maxiguido Ma sveglia! Ogni mattina apri il giornale, le cazzate che ci sono scritte tracimano come un blob e a voi va tutto bene?
Se apro un giornale voglio leggerci delle notizie, non quello che fa piacere a qualcuno.
Ed è così per TUTTO, dalla guerra alla politica alla sanità.

